A value is checked here to see whether it is null, but this value can't be null because it was previously dereferenced and if it were null a null pointer exception would have occurred at the earlier dereference. (<a href="/docs/en/findbugs/fb_checker_ref.html#FB.RCN_REDUNDANT_NULLCHECK_WOULD_HAVE_BEEN_A_NPE" target="_blank">From FindBugs&trade; description</a>)
